import { ADD_ORGID } from "../actiontypes";

const initialState = {
    id:"",
    orgid:"",
};

export default function(state = initialState, action) {
    switch (action.type) {
        case ADD_ORGID: {
            const { id, att } = action.payload;
            return {
                ...state,
                id:id,
                att:att,
            };
    }
    default:
        return state;
    }
}
